                <div>
                    Card {currentCard+1} of {2}
                </div> 
                <div>
                    {cards[currentCard].front}
                </div>
                    <div>
                        {cards[currentCard].back}
                    </div>
                <div>
                    <button></button>
                </div>
            </div>
    )

}
